@-moz-document domain("577gc.me") {
body {
/*background: #EEE;*/
color: #000;
margin: 0px;
text-align: center;
}

#content > img{width:100%;}


#main {
width: 950px;
padding: 0px;
border: none;
margin: 0 auto;
background-color: white;
  overflow: hidden;
}

#header {
display:none;
}
#footer {
margin-top: 5px;
display:none;
}

#content > a {
line-height: 30px;
}

#content > a:hover {
LEFT:0pt;
POSITION: relative; 
TOP: 0pt; 
VISIBILITY: visible;
color: #00A30D;
}

#content > a:visited  {
LEFT:0pt;
POSITION: relative; 
TOP: 0pt; 
VISIBILITY: visible;
color: #0052BB;
}



}
